  return (
      <div id={todo.id} className={todo.complete ? "todo strike" : "todo "}>
        <p>
          {todo.task}
        </p>
        <button className={'btn'} onClick={() => completeTodo(index)}>
          Complete
        </button>
      </div>
  );
};

export default Todo;
